import React from "react";
import Button from "./Button";
import { Route, Link } from "react-router-dom";

export default function Home() {
  return (
    <div>
      <Link to="/nested">click</Link>
      <Route path="/nested" exact component={() => <div>Nested route</div>} />
      <Button />
    </div>
  );
}
